INSERT INTO `data_award` (`ID`, `AWARD`) VALUES
(1, 'Information and formalities necessary for evaluating if the requirements are met: The contracting authority shall exclude from the procedure for awarding a public contract every economic operator:\nThat in the last 5 years has been rendered a final decision for participation in a criminal organization corruption, fraud or money laundering:\nWho has been given a supporting ban on participation in procedures for public announcement, the award of public supply contracts and public private partnership\nWho has a minor penalty imposed temporary or permanent prohibition of certain activities\nWho is in the process of bankruptcy or liquidation proceedings\nWho has unpaid taxes and other taxes\nWho has been given sanction\nprohibition of professional activity or duty, ie temporary prohibition for performing certain activities\nWho gives false information or fails to submit the data requested by the contracting authority.'),
(2, 'Information and formalities necessary for evaluating if the requirements are met: \nVehicle bidder should have experience in the delivery of a minimum of 3 reportage vehicles with similar features in the last 3 years\nBidder vehicle to provide a guarantee for technical correctness reportazhnoto vehicle for a period of not less than 36 months from the date of delivery\nBidder reportage vehicle required to provide service and spare parts of the territory of the Republic of Macedonia for a period of 5 years after expiry of the warranty for technical correctness. Minimum level(s) of standards possibly required:\nList of the principal deliveries bidders were in the last 3 years, with the sums, dates and customers, which can be seen that by now delivered a minimum of 3 reportage vehicles with the same or similar characteristics, by providing confirmation of deliveries issued recipients or if such certificates can not be provided due to reasons beyond the control of the economic operator');
