INSERT INTO `data_contracts_description` (`ID`, `ID_CONTRACT`, `DESCRIPTION`, `ADDITIONAL_INFO`) VALUES
(1, 1, 'This proposal includes all tasks that are essential to maintain the European added value of the Survey of Health, Ageing and Retirement in Europe (SHARE) and to keep the 16 national surveys well integrated. It complements the national financing mode of data collection as result of the ESFRI process by keeping its centrifugal forces in bounds. \r\n\r\nIt will keep up our excellence in service provision as well as in science by: \r\n1. Fostering the culture of cooperation between designers and users of SHARE by organizing user conferences, offering specialized training courses for users and interviewers, expanding web services and developing standards and procedures within the network that will make more efficient use of the research infrastructure. \r\n2. Improving the multinational services for users in EU member countries, associated countries and third countries by a more efficient centralized data base management that will provide detailed synopses and concordances across member countries. We will coordinate this work with our sister surveys in the UK, US, China, India, Japan, Korea and Thailand, thereby providing a platform for global access to ageing data. \r\n3. Pushing the state-of-the-art in interdisciplinary panel construction further such that SHARE will maintain its status as a leading edge research infrastructure. ', 0),
(2, 1, 'The project will leverage our research on response behaviour to minimize attrition; it will develop a multi-mode interviewing facility tailored to the 50+ in order to reduce survey costs; it will develop innovative questionnaire modules on biomarkers, physical health, social networks, pension claims, time use and nutrition that will keep SHARE at the forefront of empirical science; and, with the help of EUROMOD, it will harmonizes income concepts across EU-surveys, notably EU-SILC in order to facilitate the measurement of material well-being in times of rapid demographic change with its complex implications for old-age income provision.', 1),
(3, 2, 'While access to anonymous official micro-data for researchers is still uneven both at national and at European level, access to highly detailed and sensitive micro-data is now increasingly on the agenda. Different member states have substantially different outcomes for research access to Official data, and the issue is not just efficiency, but real harm to the contribution of the social sciences to democracy in an information society. Therefore the primary impact of this application is to prepare the essential relationships and build trust, common view and agreements on standards between the European Statistical System led by Eurostat, other stakeholders as the Central banks, the Data Archives European network (CESSDA) and the researchers who are the final users; from access as a postcode lottery, to an integrated model where the best solutions for access are available irrespective of national boundaries and are flexible enough to fit national arrangements. ', 0),
(4, 2, 'It aims at: \r\na) discussing frameworks and proposing pilots for a European accreditation and a distributed remote access for confidential micro-data to be expanded later to other partners, both for national and European datasets; \r\nb) fostering discussions and promoting improvements and solutions for the entire communities through annual/bi-annual European data Forum, regional workshops, users conferences, training sessions, staff visits \r\nc) preparing an easy and single point of access (What data are available? How can I access them?) for the researchers, to be linked to the CESSDA portal where NSIs metadata could be harvested when not available through the CESSDA archives still providing access to official micro-data; \r\nd) immediately enhancing access to official data making European datasets more useable (metadata, routines) and supporting foreign researchers transnational access both on site and through remote access system to countries official micro-data. \r\n\r\nClose coordination with the European Statistical System discussions and initiatives as well as with on-going and future related projects is developed to ensure maximum synergy and incorporation of outputs.', 1),
(5, 3, 'At the core of this research proposal is the aim of reconstructing and understanding the nature, exact trajectories, mechanisms and implications of cross-cultural contact and transfers between Europeans and the native people of the Americas, focusing on, but not limited to, the Nahuatl-speaking zone of central Mexico. A major innovation of this project is to study this process of cross-cultural communication in its full historical depth, through the colonial and postcolonial eras up to the present day and encompassing different stages and types of contact. The meticulous and cross-disciplinary study of an extensive body of texts in Nahuatl (Aztec) and Spanish, complemented by present-day ethnolinguistic data, will make it possible to deduce and understand patterns across time and space in ways novel to existing scholarship, embracing both micro- and macroregional trends.', 0),
(6, 3, 'The proposed research starts with identifying transfers in language, studied systematically through the creation of extensive databases, but leads to exploring the substance of cross-cultural transfer and the essence of developments, becoming a fundamental way of studying culture and its transformations. Thus, an important aim is the correlation of language phenomena with more general contact-induced culture change, including especially evolving forms of political, social and municipal organization in the native world, where the change is more salient. Breaking existing disciplinary boundaries in the humanities, the project embraces both indigenous and European perspectives, assuming that the innovation of studying both sides in a single framework and in the proposed time span is particularly promising in dealing with a notably two-sided, prolonged historical process. The complementary lines of research, native and Spanish, are expected to highlight and make understandable factors underlying and facilitating cultural convergence between them in different aspects of colonial life and beyond.', 1),
(7, 4, 'Pharaonic Egypt is commonly known for its pyramids and tomb treasures. The present knowledge of Egyptian everyday life and social structures derives mostly from mortuary records associated with the upper classes, whereas traces of ordinary life from domestic sites are generally disregarded. Settlement archaeology in Egypt and Nubia (Ancient North Sudan) is still in its infancy; it is timely to strengthen this field. Responsible for the pottery at three major settlement sites (Abydos and Elephantine in Egypt; Sai Island in Sudan), the PI is in a unique position to co-ordinate a research project on settlement patterns in Northeast Africa of the 2nd millennium BC based on the detailed analysis of material remains. The selected case studies situated across ancient and modern borders and of diverse environmental and cultural preconditions, show very similar archaeological remains. Up to now, no attempt has been made to explain this situation in detail.', 0),
(8, 4, 'The focus of the project is the well-preserved, only partially explored site of Sai Island, seemingly an Egyptian microcosm in New Kingdom Upper Nubia. Little time is left to conduct the requisite large-scale archaeology as Sai is endangered by the planned high dam of Dal. With the application of micro-archaeology we will introduce an approach that is new in Egyptian settlement archaeology. Our interdisciplinary research will result in novel insights into (a) multifaceted lives on Sai at a micro-spatial level and (b) domestic life in 2nd millennium BC Egypt and Nubia from a macroscopic view. The present understanding of the political situation in Upper Nubia during the New Kingdom as based on written records will be significantly enlarged by the envisaged approach. Furthermore, in reconstructing Sai Island as home away from home, the project presents a showcase study of what we can learn about acculturation and adaptation from ancient cultures, in this case from the coexistence of Egyptians and Nubians.', 1),
(9, 5, 'PLACES Networks partners are developing a common platform for a wide and diverse community of actors to promote the cooperation in their science communication activities, at city/regional level. Over four years, 67 science communication institutions (science centres, museum, festivals) are supported to work with their local authority administrators and policy makers to plan and implement their long-term co-operation for the ?city of scientific culture?. PLACES promotes the City of Scientific culture at regional levels via the ERRIN network, whose regional members host the most advanced ?science cities? and at city level where ECSITE/EUSCEA science communicators have engaged their local authorities in the project, by creating a formal City Partnership (CP). ', 0),
(10, 5, ' The 3 PLACES partner networks (ECSITE/EUSCEA/ERRIN) create a cyber-platform for their selected members and organize many meetings merging the various types of actors and producing thematic reports and concrete recommendations. At the city level, members of ECSITE and EUSCEA receive support to produce a City Action Plan, a Local Survey and, if selected, a seed money grant to launch a new activity. Local and regional authority administrators receive training and support via the expertise of science communicators. An independent European team of academic researchers assesses the impact of activities in 10 science centres, 10 events and 10 cities, by selecting with neutrality among the PLACES participants (around 70 cities). The numerous operational links stimulated by PLACES will generate much new knowledge which will be used to define, at a European level, models and recommendations toward various political level. With PLACES a European community of professionals from 28 countries will share and exchange experiences and information around the dedicated cyber-platform OPEN to be maintained permanently as a new service of dissemination after the project completion.', 1),
(11, 6, 'All plant cells, maintain a pH gradient across the vacuolar membrane throughout their life. An acidic vacuolar environment is necessary for activation of many vacuolar functions, while a neutral environment is required for most cytoplasmic functions. The mechanisms by which pH-homeostasis is achieved are still not clear. In petunia, as in all coloured flowers, the vacuole is the place of storage for the anthocyanin pigments. \r\n\r\nAnthocyanins behave as pH indicators and allow one to recognize mutants by their blue flower colour. In this way we identified 7 distinct PH loci in petunia that control vacuolar pH in the flower petals. We recently isolated PH4 and PH3 and found that they encode transcription factors, which presumably control the activity of downstream genes and proteins. Interestingly, we found that AN1, AN2 and AN11, transcription activators of the anthocyanin pathway, are also involved in pH regulation. To understand the biochemical mechanisms by which pH is regulated, we isolated a pool of target genes/proteins controlled by these regulatory PH and AN genes by cDNA-AFLP and microarray analysis. ', 0),
(12, 6, 'The project presented here aims to characterize the target genes of the PH regulators to unravel the biochemical pathway responsible for pH control in flower epidermal cells. The project involves a broad spectrum of techniques (molecular and cellular biology, genetics and cell physiology) and therefore constitutes an excellent, multidisciplinary and complete training program.', 1),
(13, 7, 'Eastways of Science aims to implement Highways of Science, the project that Favino is still carrying on thanks to a Marie Curie EIF. Highways of Science purposes to use electronic sources to publish on-line ac accurate map of the network constituting the Republique des lettres in the age of Scientific Revolution. It aims to construct a prototype of a multitask data-base user-friendly, that takes into account evidence gathered from scientific and learned correspondences (personal biographies, scientific institutions, instruments, natural specimina and objects, places related to scientific practices) so as to define and highlight the contents, the networks and the ways of transmission of cultural and scientific information in early modern West Europe. Information will be arranged and available in a spatial fashion, so as to construct a map of information fluxes in that cultural space, following the model of a traffic stream visualized on a luminous screen.', 0),
(14, 7, 'Eastways of Science purposes to extend such inquiry to middle-east Europe, especially Poland and the border of the Habsburgh Empire (Moravia, Bohemia, Hungary and Romany) in the second half of XVIIth century. To succeed in, the researcher and the host institution plan to cooperate with academies and research institutes in Poland, Hungary, Czech Republic, Slovack Republic and Romany who are working on electronic editions of sources of historical interest. The ERG program is for Favino an extraordinary opportunity to reintegrate the Italian university and to obtain a long-term job at the University of Teramo.', 1),
(15, 8, 'The HERCULES Course is designed to train young European researchers, either Phd students or post doctoral scientists to optimise their use of the Large Installation (L.I) of neutron (n) and synchrotron radiation (S.R) for studies in the fields of Solid State Physics and Chemistry, Structural Molecular Biology, Materials Science, Geoscience and Industrial Applications. Since its inception in 1991, the principal emphasis of this course has been placed on laboratory practicals carried out in four partner L.I. (ESRF, ILL, LURE, LLB), accompanied by tutorials and lectures. The need for such a training at a European level has been clearly expressed: at the end of the 1999 session, about 650 European young researchers will have attended the course, out of 1200 applicants, with the permanent financial support of the CEC (Science, HCM, TMR).', 0),
(16, 8, 'One of the aims of HERCULES was to help build a European network of young researchers using n. and S.R. for condensed matter studies. In this context, on the occasion of the 10th anniversary of the Course, we wish to reactivate the links and reinforce the contacts between the past HERCULES participants by organizing the HERCULES X EuroConference at the end of the normal HERCULES 2000 sessions. The main objective of this EuroConference is to bring together all the HERCULES participants (past and HERCULES 2000 sessions) and high level lecturers on challenging topics and highlights related to recent developments and applications of n. and S.R. in the multidisciplinary fields covered by the Courses. The organizers will do their best to magnify, as far as possible, the scientific exchange between all the attendees (HERCULES participants, invited lecturers, ESRF and ILL permanent scientists) via oral contributions, poster sessions, clips and round tables. To create synergy between academia and industry, two thematic sessions will be devoted to new techniques, new instrumentation and industrial application.', 1),
(17, 9, 'Due to globalisation and internationalisation, we can see the links between the built and natural environments, or urban landscape, rapidly mutating in Europe and in many countries around the world. We are confronted by an upheaval of the cultural links, e stablished over the centuries, between societies and surrounding territories. The essential question of the sustainable development of towns is directly related to these mutations. To handle those transformations, and to be able to imagine some comparativ e referential, we need to conceive a precise and rigorous description of these urban landscapes as spatial and physical objects which help to control the social variables of their organisation. For this measuring system to be adequate, we will need to take into consideration the diversity of milieus, the multiplicity of relations between societies and their environments. In fact, depending on those relationships, a double phenomenon is activated.', 0),
(18, 9, ' There are the transformations of the environment, and on the other hand there are the societies that are always changing their appreciation and perception of those environments. Also, the aim of this research is to establish a methodological tool based on a dual, syntactical approach and on a hermeneutic system, ta king in consideration the multiplicity of perceptions linking societies to their surrounding urban landscape. The intention of this research is to associate from a theoretical and practical point of view the investigations made into the built environment by the Space Syntax laboratory of London University College with the works done about landscape by the laboratory and post-graduate course \\"Gardens, Landscapes, Territories\\" of the School of Architecture of Paris la Villette. The objective would be to f ormulate an original methodology and primary tools, which could be used for analysis of urban landscape throughout the world, and to propose some solutions for their sustainable change.', 1),
(19, 10, 'Project reference: HPHA-CT-2001-03000\r\nStatus: Completed\r\n\r\nTotal cost: EUR 119 078\r\nEU contribution: EUR 59 539', 0),
(20, 10, 'Programme acronym: \r\nFP5-HUMAN POTENTIAL\r\nContract type: \r\nPreparatory, accompanying and support measures', 1),
(21, 11, 'The proposed conference is intended to help to improve the self-governing capacity of regions. Regional governance is defined as weak forms of regional steering modes based on networks, conventions, norms and contracts. Modes of regional governance have developed during the last years in reaction to structural adjustment processes on the level of regions. Regional governance gains growing importance as the European Community and its Member States are endeavouring to boost the regions as societal levels of self-governance. However, that kind of self-government is embedded and dependent on existing cultural as well as institutional framework conditions. To discuss this the international and interdisciplinaire EuroConference "Regional Governance - New Modes of Self-Government in the European Community" is planned in February 2001 in Hannover. ', 0),
(22, 11, ' The objective of the conference will be twofold: first, to clearer envisage what different forms regional governance may have in different contexts, how the process of European integration also works in favour of regional governance and, finally, how regional governance could be shaped in order to make regions more competetive actors in a globalised world. The second objective will be to induce international networks of researchers who should elaborate topics in need of further research during the conference.', 1),
(23, 12, '"International Conference on Research Infrastructures: Centres of exchange, cohesion and excellence for the European Research Area"', 0),
(24, 12, 'Project reference: 980089\r\nStatus: Completed\r\n\r\nTotal cost: EUR 121 400\r\nEU contribution: EUR 79 500', 1),
(25, 13, 'Modern material science aims at understanding the properties of (bio)materials at the molecular level. In this development, molecular simulation will play an important role in both the interpretation of the experimental data as well as to guide the experim ental efforts. Key aspects in the present proposal is that we plan to achieve this goal by a hierarchical approach, which relies on an intelligent and controlled way of combining advanced simulation techniques to bridge the time and length scales between t he molecular behaviour and the macroscopic properties. To demonstrate the interdisciplinary character of this approach we plan to apply this approach to two different applications related to molecular system biology and molecular materials science. Within the framework of system biology we aim to obtain fundamental insight in the collective behaviour of peptides embedded in a biological membrane and in material science we will investigate the effect of confinement on diffusion and catalytic properties. The field of molecular simulations is one of the scientific areas in which Europe has a leading position.', 0),
(26, 13, 'European research teams are internationally recognized for the development and application of novel algorithms. One of the factors contributing to this Eu ropean success is the unique position of CECAM (European Centre of Atomic and Molecular Computations). CECAM is a top-level institute based in Lyon that is supported by 14 European organizations and is aimed at networking activities (workshops and tutorial s). The present proposal takes advantage of this unique position and the support will be used to create a European Research Centre of Excellence that will be located at CECAM in collaboration with the universities in the Lyon region. The present proposal a llows the present director of CECAM to create such a centre. The networking activities at CECAM give this centre a truly European dimension and an excellent international exposure.', 1),
(27, 14, 'The proposed study draws data from an ongoing European Commission DG XII funded cohort study entitled: " Behavioural, immunological and virology correlates of HIV-1 infection and super infection in rural Tanzania" The applicant was responsible for setting up an open cohort of 600 female bar workers who are seen on a three- monthly basis over three years creating data on about 7000 separate contacts. Follow up was 85% after one and a half years of the study and HIV and STI incidences remained high. Data collection for the proposed study will be completed by the start of the fellowship. The overall objective of the proposed research combining social science with medicine in a multidisciplinary approach is to contribute to the development of reliable and valid monitoring tools for measuring risk behaviours influencing the transmission of HIV and STI.', 0),
(28, 14, 'The specific objectives and methods are the following:\r\n1. To analyse HIV, STI and socio-behavioural data of the high-risk cohort using appropriate statistical techniques.\r\n2. To compare different methods for self-reported risk behaviour (face-to-face reports, self-administered questionnaires and diaries) through comparison of reliability of answers in different formats.\r\n3. To validate self reported risk behaviour against biomarkers for STI (Gonorrhoea, Chlamydeous, Trichomonas, Syphilis), HIV, HSV-2, pregnancy and sperm through cross-tabulation of selected self-reported risk factors with biomarkers.\r\n4. To test the most reliable methods for obtaining self-reported risk behaviour in an existing general population cohort, and to investigate feasibility and usefulness of biomarker checks in this setting. The European Community funds several research studies within the INCO Programme and intervention programmes within its HIV/AIDS programme in need of improved strategies for obtaining valid data on sensitive issues. All research and intervention activities would benefit greatly from the outcome of this study.', 1),
(29, 15, 'Feelings and perceptions of insecurity (e.g. fear of crime) as well as security regimes and policies (especially community crime prevention and community policing) will be examined in five major European cities.\r\nThe guiding research questions will be\r\na) how the actual transformation processes in these cities (indicated by globalisation, individualisation, social invalidation, and marginalisation) shape and change the emotional and cognitive attitudes and the behaviour of their inhabitants,\r\nb) how these changes are related to socio-spatial factors,\r\nc) which resources on an individual as well as on the communal level light be actualised and, finally,\r\nd) which policies on an national and on an European level seem to be suitable in order to prevent given and foreseeable insecurities in these and similar European cities.', 0),
(30, 15, 'Project reference: HPSE-CT-2001-00052\r\nStatus: Completed\r\n\r\nTotal cost: EUR 999 988\r\nEU contribution: EUR 999 988', 1),
(31, 16, 'Dendrimers are new materials obtained with a highly controlled molecular structure in several space orientations. Liquid Crystals (LC) Dendrimers are a part of them that incorporate directional properties to these materials. If we append active molecules into these engineered molecules, we can obtain multifunctional anisotropic molecules that open the possibility of achieving a wide variety of physical properties and new applications. Among the numerous possibilities to be explored within this field, we have chosen two fundamental lines, which are Biomedicine and Advanced Molecular Materials. Training of multidisciplinary personnel in this field of research will contribute to concentrate the knowledge spread in different countries and to accelerate the development within Europe by means of industrial collaboration.', 0),
(32, 16, 'This collaboration will provide an up-to-date list of requirements for better planning the research lines that ensure a rapid evolution of the existing ones in Europe, all of which are oriented to the synthesis of compounds easily transferable to industrial use. The aim is to reduce the existing gap between academically developed new materials and their industrial application. Multidisciplinary training will include modelling of new materials, chemical synthesis and controlled chemical orientation.', 1),
(33, 17, 'Catalysis is at the heart of chemical sciences because it is the art of selectively making and breaking chemical bonds. It is for this reason that it has been a major topic in various fundamental research programs in the past, and also it has served as an important innovative technology in industry. The research efforts in the past decades generally resulted in incremental improvements, with occasional new reactions found by serendipity. It is clear that radical new approaches are required to enforce a breakthrough in this area. We would like to use Nature''s most powerful concept, evolution, as a source of inspiration to develop (r)evolutionary catalysts.', 0),
(34, 17, 'The implementation of the new concepts in industry will be accelerated through the involvement of DSM in this network, one of the leaders in the use of homogeneous catalysis and biocatalysis in fine chemicals production. It is important to train the young researchers in the many aspects of catalysis. This network will provide the ideal environment for this training. The ESR/ER will learn the importance of catalysis in the industrial context and how to implement catalysis in synthetic pathways. They will be trained in high throughput experimentation and the use of sophisticated robots in synthesis, catalysis and analysis.\r\n\r\nThey will be taught the many different types of catalysis, such as homogeneous catalysis, biocatalysis and organocatalysis, and the value of molecular calculations supporting experimental work. It is clear that researchers trained in the above manner and exposed to the new research concepts will tremendously increase their chance of employment in the European chemical or pharmaceutical industry. In addition, they will help these industries to increase their competitiveness, which will allow them to compete with the low-wage Asian countries.', 1),
(35, 18, 'Project reference: HPAW-CT-2002-10001\r\nStatus: Completed\r\n\r\nTotal cost: EUR 429 531\r\nEU contribution: EUR 322 149', 0),
(36, 18, 'Programme acronym: \r\nFP5-HUMAN POTENTIAL\r\nContract type: \r\nPreparatory, accompanying and support measures', 1),
(37, 19, 'This conference aims at inter-disciplinary appraisal of gender research in the thematic areas of bio-technologies and information technologies technologies. The conference will give equal attention to methodological and also to the socio-economic aspects of current gender research on technological culture. The framing concept is the definition of gender as a multi-layered notion that structures both the social and the symbolic differences between the sexes, but it is also takes into account the impact of ethnicity, race, religion and culture.', 0),
(38, 19, 'It thus emphasizes the importance of cultural diversities among women. The objectives of the conference are: 1) To provide a comprehensive and critical assessment of the state of the art of gender research in the selected thematic areas within the EU; 2) To develop the European dimension of gender research in the selected thematic areas. The priority given to cross-European perspectives aims at both balancing the uneven development of gender studies within the EU, especially along the North-Souht axis and to bring them in a dialogue with the mainstream research in the English language, especially in the USA; 3) To highlight the specific methodologies and the epistemological frameworks introduced by gender research in order to assess their innovative potantial and to translate them in terms are accessible to the wider scientific community; 4) To link the methodological and theoretical issues of gender research in the areas of technology to socio-economic issues related to women''s access to and participation in today''s technological societies. Considering the gender gap, which still exists in technology access, one of the state aims of this conference is to deepen the understanding of the factors that hinder women''s access to citizenship and decision-making in the technological area; 5) To contribute to gender-aware policy-making in science and technology so as to facilitate women''s increased participation in the designing of gender research and policies in these areas.', 1),
(39, 20, 'Over the last 15 years the discovery of metallocene-based catalysts for the polymerisation of olefins has rejuvenated and innovated the polyolefin industry in an unprecedented way. Whole families of new polymer and copolymer materials that were previously inaccessible can now be made at will and with predetermined properties. These materials are now breaking into new types of applications, and consequently this is internationally a highly competitive research area. More recently, in addition to the well known and highly successful metallocene catalysts, a range of non- metallocene complexes have been developed which show high activity for the polymerisation of alkenes, copolymerisations of alkenes with CO, and for copolymerisations with polar monomers. These catalysts promise to produce new ranges of materials that are not accessible today, and consequently there is intense international research effort in this area.', 0),
(40, 20, ' In addition, industry realises that polymers derived from sustainable sources and which are biodegradable will be increasingly important. In particular, research in underway to find new, selective catalysts for the synthesis of polyesters, notably polylactide from biomass. Many of the non-metal locene catalyst types suitable for olefin polymerisation are equally suitable here. The work is likely to produce results with high industrial potential and exploitable IPR. As is in the nature of catalysis research, the distance from invention to implementation and wealth generation can be very short for successful catalysts. The project will provide high-quality scientific training in an industrially highly relevant and sought-after area and reinforce the European research potential.', 1),
(41, 21, 'Municipalities are the eGovernment organizations with which citizens interact most frequently in order to request/process certificates, pay city taxes and receive city information. Citizens need to trust their local municipalities and the municipalities are obliged to provide confidence to their citizens that they fulfil their mission in an effective way.\r\n\r\nPublic documents and services impose all security requirements i.e. confidentiality, authentication of data and user, integrity, non repudiation. The replacement of the traditional signature with the digital signature imposes problems when applied cross-border or by a group of citizens with limited IT training and security exposure. The adoption of e/m-services by medium and small size public organisations is difficult, as it requires expertise in technical, organizational as well as legal, political and financial support. Municipalities therefore, have difficulties in making the next step in offering services to the European citizens throughout the European continent.', 0),
(42, 21, 'With this proposal we aim to contribute towards the provision of secure and interoperable eGovernment services, by developing an affordable, ease-of use- electronic platform (eMayor platform) hosting secure municipal Web Services. In order for the eMayor platform to be successfully deployed across Europe, on one hand, it will be a simple open solution based on widely accepted standards with good market support. On the other hand, the platform will be Internet based and will enable communication with legacy as well as newly developed systems residing on heterogeneous platforms. Web Services and XML address both sets of requirements and therefore these technologies will form the core for the R&D effort and implementation. eMayor will highly consider the barriers imposed by small and medium sized public organisations and it will meet their needs. The project will put a great effort in making eMayor platform a standard for such organisations.', 1);
